import React from "react";
import styles from "./Sort.module.scss";
const Sort = () => {
  return (
    <div className={styles.sort}>
      <ul className={styles.list}>
        <li className={styles.element}>liked</li>
        <li className={styles.element}>unliked</li>
      </ul>
    </div>
  );
};

export default Sort;
